/** Credentials used for SDK and ChatBot to access the API */
export interface Credentials {
    tenantURL: string;
    token: string;
}
/** Credentials used for SDK to access the API, for use in web apps where auth token is not available,
 * and cookie auth + CSRF token is used instead */
export interface WebCredentials {
    tenantURL: string;
    csrfToken: string;
}
